import React, { useState } from 'react';

// Компонент SortTable
const SortTable = ({ products, setProducts }) => {
  const sortProducts = (field) => {
    const sortedProducts = [...products].sort((a, b) => a[field] > b[field] ? 1 : -1);
    setProducts(sortedProducts);
  };

  return (
      <table>
        <thead>
        <tr>
          <th onClick={() => sortProducts('name')}>Наименование</th>
          <th onClick={() => sortProducts('price')}>Стоимость</th>
          <th onClick={() => sortProducts('quantity')}>Количество</th>
          <th>Изображение</th>
          <th>Описание</th>
          <th onClick={() => sortProducts('isNew')}>Новинка</th>
          <th onClick={() => sortProducts('discount')}>Скидка</th>
        </tr>
        </thead>
        <tbody>
        {products.map((product, index) => (
            <tr key={index}>
              <td>{product.name}</td>
              <td>{product.price}</td>
              <td>{product.quantity}</td>
              <td><img src={product.image} alt={product.name} style={{ width: '50px' }} /></td>
              <td>{product.description}</td>
              <td>{product.isNew ? 'Да' : 'Нет'}</td>
              <td>{product.discount}%</td>
            </tr>
        ))}
        </tbody>
      </table>
  );
};

// Компонент Catalog
const Catalog = ({ products }) => {
  return (
      <div>
        {products.map((product, index) => (
            <div key={index}>
              <h2>{product.name}</h2>
              <p>Стоимость: {product.price}</p>
              <p>Количество: {product.quantity}</p>
              <img src={product.image} alt={product.name} style={{ width: '50px' }} />
              <p>Описание: {product.description}</p>
              <p>Новинка: {product.isNew ? 'Да' : 'Нет'}</p>
              <p>Скидка: {product.discount}%</p>
            </div>
        ))}
      </div>
  );
};

// Главный компонент
const App = () => {
  const [products, setProducts] = useState([
    {
      name: 'Товар 1',
      price: 100,
      quantity: 10,
      image: 'url_изображения_1',
      description: 'Описание товара 1',
      isNew: true,
      discount: 10
    },
    {
      name: 'Товар 2',
      price: 200,
      quantity: 20,
      image: 'url_изображения_2',
      description: 'Описание товара 2',
      isNew: false,
      discount: 20
    },
    {
      name: 'Товар 3',
      price: 300,
      quantity: 30,
      image: 'url_изображения_3',
      description: 'Описание товара 3',
      isNew: true,
      discount: 0
    },
  ]);

  return (
      <div>
        <SortTable products={products} setProducts={setProducts} />
        <Catalog products={products} />
      </div>
  );
};

export default App;
